class Solution:

    def findScore(self, nums: List[int]) -> int:
        marked = [False] * len(nums)
        score = 0
        while not all(marked):
            min_val = float('inf')
            min_index = -1
            for (i, num) in enumerate(nums):
                if not marked[i] and num < min_val:
                    min_val = num
                    min_index = i
            score += min_val
            for j in range(min_index - 1, min_index + 2):
                if j >= 0 and j < len(nums):
                    marked[j] = True
        return score

